import './App.css';
import Topbar from './Components/Topbar';
import Leftpane from './Components/Leftpane';
import Chatpane from './Components/Chatpane';
import userContext from './context/users/userContext';
function App() {
  return (
    <div className="App">
      <userContext>

      <div className="all">
        <Topbar />
        <div className="below-top">
          <Leftpane />
          <Chatpane />
        </div>
      </div>
      </userContext>
    </div>
  );
}

export default App;
